Verenigde Staten
Thriller
85 minuten

goed

met Rachel McAdams, Cillian Murphy en Brian Cox

Lisa Reisert heeft een hekel aan vliegen maar gaat toch op een vlucht naar Miami. Enkele minuten na het opstijgen onthult de man 
die naast Lisa zit, Jackson, de echte reden waarom hij aan boord is: hij heeft de opdracht een rijke en machtige zakenman om te 
brengen. Lisa is de sleutel tot succes in dit moordplan en als ze weigert mee te werken zal haar vader worden vermoord door een 
huurmoordenaar die op een telefoontje wacht van Jackson.
